import Link from "next/link"; // Ferramenta do next para linkar outras páginas

const Index = () => {
    return (
        <div>
            <h1>Olá semana FullStack Master</h1>
            <div>
                <Link href = "/sobre"> 
                    <a>Sobre</a> 
                </Link>
                <Link href = "/contato">
                    <a>Contato</a>
                </Link>
                <Link href = "/pesquisa">
                    <a>Pesquisa</a>
                </Link>
            </div>
        </div>
    )
};


export default Index;
